        var roleStored = [];
        var embed = {
            "title": "Automatyczny system captcha",
            "description": `Podaj rolƒô, role id, lub nazwƒô roli aby ustawiƒá dla niej kana≈Ç captcha!\n\nJe≈õli chcesz wy≈ÇƒÖczyƒá captcha, poprostu napisz 0\n\nJe≈õli chcesz w≈ÇƒÖczyƒá captcha, ale nie przypisywaƒá roli, poprostu napisz 1\n\nJe≈õli chcesz wprowadziƒá wiele r√≥l, odpowiedz, podajƒÖc id lub wzmiankƒô o roli.\n Role powinny byƒá oddzielone spacjami. Ka≈ºdy format wzmianki dzia≈Ça.\n\nNie **mo≈ºesz** mieszaƒá wzmianek i identyfikator√≥w. LiczƒÖ siƒô tylko wzmianki.`,
            "color": 0x00ff00
        }
